/* eslint-disable import/no-anonymous-default-export */
import { fromJS } from 'immutable';

// immutable这个库可以把一个JS对象转化成immutable对象
const defaultState = fromJS({
  topicList: [],
  articleList: [],
  recommendList: []
});

export default (state = defaultState, action) => {
  switch(action.type) {
    default:
      return state;
  }
}
